        foreach ($states->states as $state) {
            $stateModel = new State();
            $stateModel->name = $state->name;
            $stateModel->local_name = $state->nameLocal;
            $stateModel->display_name = $state->displayName;
            $stateModel->save();
                if(!empty($state->cities))
                foreach ($state->cities as $city) {
                    $cityModel = new City();
                    $cityModel->state_id = $stateModel->id;
                    $cityModel->name = $city->name;
                    $cityModel->local_name = $city->nameLocal;
                    $cityModel->display_name = $city->displayName;
                    $cityModel->save();
                    if(!empty($city->postal))
                        foreach ($city->postal as $postal) {
                            $postalModel = new PostalCode();
                            $postalModel->city_id = $cityModel->id;
                            $postalModel->name = $postal->name;
                            $postalModel->local_name = $postal->nameLocal;
                            $postalModel->display_name = $postal->displayName;
                            $postalModel->save();
                        }
                }
